import React from "react";
import styled from "styled-components";


class NFTList3 extends React.Component {
  render() {
    const { className } = this.props;

    return (
      <NFTList className={`nft-list-15 ${className || ""}`}>
        <Rectangle8 className="rectangle-8-1" src="/img/rectangle-8@2x.svg" />
      </NFTList>
    );
  }
}

